function Navbar() {
    return (
        <div className="navbar">
            <Search/>
            <NavbarRight/>
        </div>
    )
}

function Search() {
    return (
        <div className="search">
            <input type="searchinput" placeholder="Search" className="searchinput"/>
             <img src="../images/search-icon.png" alt="Search item" className="searchicon"/>   
            
        </div>
    )
}

function NavbarRight(){
    return(
        <div className="navright">
           <img src="../images/ic_round_notifications.png"/> 
           <img src="./images/bi_chat_left_dots_fill.png"/> 
        </div>
    )
}

export default Navbar;
